		latitude = -35.152;
		loadingTexts[] = {"Altis covers an area of 270.5 square kilometers.", "The geographic coordinates of Altis are 35°9'5.12''N 16°39'37.60''E.", "Altis is a volcanic island with corrugated terrain and plentiful rocky areas.", "Total area of the Republic of Altis and Stratis is slightly smaller than twice the size of Washington, D.C.", "Pyrgos is an important port and the newly established capital of the Republic of Altis and Stratis.", "The highest point of Altis is the peak of Thronos (350 m above sea level), with the ruins of a castle built by Arabian warlords in the middle ages.", "The population of Altis traces its origin to the Phoenician civilization of traders and explorers, but all of the rulers left traces in the populace in past centuries.", "Today's city of Kavala was founded by Venetian merchants on the ruins of a Phoenician city, and was the island's capital for several centuries.", "The Airstrip of the Altis Aero Club was the first airfield on the island, built in 1916 by the British.", "There is a desert north of village of Abdera, featuring a truly unique environment and popular sightseeing spot for adventurers.", "There are 3 periodically flooded salt lakes in the east of Altis: Almyra, Limni and Ochrolimni.", "Almyra, the biggest salt lake on Altis, serves as an auxiliary airstrip during summer, when the surface is dry and hard.", "The mountain cave chapel of Agios Panagiotis north of Panochori is a popular place for local pilgrimages and festivities.", "There is a picturesque chapel on the rocky promontory over the sea in Agios Konstantinos, believed to be built on the much older remnants of an Antique temple.", "Most guides recommend a visit to several Antique ruins scattered over the island: the Old Kavala, the Amphitheater and Temple of Iraklia ruin over Pefkas Bay.", "The ruins of Pyrgos Castle can be found between the harbor and the closed complex of government offices.", "Many windmills are scattered across Altis, with the most notable ones in Zaros, Telos and Kore.", "Strong winds and plenty of sun make Altis a perfect place for renewable energy sources: many wind and solar power plants have been built in the last decade, replacing two older oil-burning power plants.", "Zaros is often called the 'Pine City' due to the pine groves surrounding it. The chapel overlooking the town is one of the nicest vantage points in the area.", "The Agia Stemma mountain with a remarkable chapel on its top provides great views on the island, but it is extremely hard to access.", "The beaches of Thelos Bay and Chalkeia Bay are popular among surfers, providing the best waves in the central Mediterranean for the last few years of global climatic changes.", "The Monument of Kalithea is commemorating one of the old legends pertaining to Altian history.", "There are 165 chapels on Altis.", "The driving distance from Pyrgos, the capital, to the ancient city of Kavala is 20 km.", "The distance from Pyrgos to the north-easternmost Cap Strigla is almost 20 km.", "The total coast length of Altis is over 200 km.", "The mountain village of Oreokastro was abandoned during the civil war.", "There are large pine forests north of Frini, covering the demand for wood for the whole archipelago.", "There is a myth that remnants of an ancient civilization lies underwater near the coast of Altis. It's possible that the shape of ancient Altis was reshaped by volcanic and tectonic activity.", "There are 49 settlements on Altis, including all towns and villages."};
