		loadingTexts[] = {"The area of Stratis is 19.3 square kilometers.", "Geographic coordinates of Stratis are 34°48'38.60""N 16°23'49.81""E.", "Stratis is of volcanic origin, with many rocks and crevices.", "The coasts of Stratis are dangerous. Many shipwrecks can be found underwater near the coastline, including two large fishing trawlers Sofia and Apex Marshall.", "In recent decades, Stratis slowly turned into a 'military island' after most of the civilian population moved to Altis.", "Part of the Agia Marina was rebuilt using simple residential houses after an earthquake damaged the town in the 1960s.", "According to legend, there is a hidden cave somewhere on the coast of Stratis, rumored to contain treasures hidden by the Arabian pirates.", "Most roads on Stratis are just gravel trails which twist and turn into the mountains. Only 5% of roads have strengthened surface.", "There are only two settlements left on Stratis: the picturesque harbor town of Agia Marina and the small fishing village of Girna.", "Camp Maxwell was named after British surveyor Martin P. Maxwell, who laid plans for artificial ground for the Stratis Airfield.", "Camp Rogain was named after the favorite pastime of NATO troops stationed in the area.", "The Spartan, a monument in the southern part of Stratis, was built to honor the memory of Altian soldiers fighting alongside the Allies in the WW2's Operation Torch.", "Kamino Firing Range uses remnants of the old Kamino village nearby as a target area.", "Stratis Airfield was built on an area of artificially laid firm ground in the 1980s by the joint effort of British and US engineers."};
